import React, {useState} from 'react';
import { TexrField, Button, Typography, Paper, TextField} from '@material-ui/core';

import useStyles from './styles';

const Form = () => {
    const [postData, setPostData] = useState({creator:'', title:'',message: '', tags: '', selectedFiles: ''
    });
    const classes = useStyles();
    const handleSubmit = () => {

    }

    return (
        <Paper className={classes.paper}>
        <form autoComplete = 'off' npValidate className={classes.form} onSubmit={handleSubmit}>
        <Typography variant = "h6">Creating a FlashBack</Typography>
        <TextField 
            name="creator" 
            variant='outlined' 
            label = "Creator" 
            fullWidth
            value={postData.creator}
            onChange={(e) => setPostData({ ...postData, creator: e.target.value })}/>
        <TextField 
            name="title" 
            variant='outlined' 
            label = "Title" 
            fullWidth
            value={postData.creator}
            onChange={(e) => setPostData({ ...postData, creator: e.target.value })}/>
            <TextField 
            name="message" 
            variant='outlined' 
            label = "Message" 
            fullWidth
            value={postData.creator}
            onChange={(e) => setPostData({ ...postData, creator: e.target.value })}/><TextField 
            name="tags" 
            variant='outlined' 
            label = "Tags" 
            fullWidth
            value={postData.creator}
            onChange={(e) => setPostData({ ...postData, creator: e.target.value })}/>
        </form>

        </Paper>

    );
}

export default Form;
